import React from 'react';

function Pagination({ currentPage, totalPages, onPageChange, pageRangeDisplayed }) {
  const renderPageNumbers = () => {
    const pageNumbers = [];

    // Calculate the start and end page numbers based on the current page
    let startPage = Math.max(1, currentPage - pageRangeDisplayed);
    let endPage = Math.min(totalPages, currentPage + pageRangeDisplayed);

    // Adjust the start and end page numbers if they go beyond the valid range
    if (startPage !== 1) {
      pageNumbers.push(
        <li key={1}>
          <button onClick={() => onPageChange(1)}>1</button>
        </li>
      );
      if (startPage !== 2) {
        pageNumbers.push(
          <li key="ellipsis1" className="ellipsis">
            ...
          </li>
        );
      }
    }

    for (let i = startPage; i <= endPage; i++) {
      pageNumbers.push(
        <li key={i} className={i === currentPage ? 'active' : ''}>
          <button onClick={() => onPageChange(i)}>{i}</button>
        </li>
      );
    }

    if (endPage !== totalPages) {
      if (endPage !== totalPages - 1) {
        pageNumbers.push(
          <li key="ellipsis2" className="ellipsis">
            ...
          </li>
        );
      }
      pageNumbers.push(
        <li key={totalPages}>
          <button onClick={() => onPageChange(totalPages)}>{totalPages}</button>
        </li>
      );
    }

    return pageNumbers;
  };

  return (
    <ul className="pagination">
      <li>
        <button onClick={() => onPageChange(currentPage - 1)} disabled={currentPage === 1}>
          Previous
        </button>
      </li>
      {renderPageNumbers()}
      <li>
        <button onClick={() => onPageChange(currentPage + 1)} disabled={currentPage === totalPages}>
          Next
        </button>
      </li>
    </ul>
  );
}

export default Pagination;
